import React from 'react'
import { makeStyles } from '@material-ui/core/styles';
import { useState, useEffect } from 'react';



const useStyles = makeStyles((theme) => ({
    //fame
    mainFame: {
        width: 933,
        height: 892,
        backgroundColor: '#FFFFFF',
        position: 'relative'

    },
    mainFameHeader: {
        height: 106,
        width: 133,
        borderBottom: '1px solid #AAAAAA'
    },
    inFame: {
        width: 748,
        height: 380

    },
    inFameHeader: {
        width: 123,
        height: 107,
        borderBottom: '1px solid #AAAAAA'
    },
    //row in fame
    rominfame: {
        width: '100%',
        height: 69
    },


    //wrap infame


    //text
    title: {
        fontSize: '28px',
        color: '#4A4A4A',
        fontWeight: 'bold',
        position: 'absolute',
    },
    title2: {
        fontSize: '24px',
        color: '#4A4A4A',
        fontWeight: 'bold',
        position: 'absolute',
        left: 92,
        top: 64

    },
    title3: {
        fontSize: '20px',
        color: '#4A4A4A',
        fontWeight: 'bold'
    },
    title4: {
        fontSize: '16px',
        color: '#4A4A4A',
        fontWeight: 'bold'
    },
    title5: {
        fontSize: '16px',
        color: '#4A4A4A',
    },

    //input
    inputSize: {
        height: 39,
        width: 234,
        fontSize: '16px',
        color: '#4A4A4A',
    },


    //button
    buttonDelete: {
        width: 35,
        height: 35
    },


    //decor
    decorLeftRight: {
        width: 51
    },




}));

export default function CreateRoomRe() {
    const classes = useStyles();


    return (
        <div style={{position: 'absolute'}}>
            <div className={classes.mainFame}>
                <div className={classes.title}>
                    Rooms
                </div>
                {/* //linedivider */}
                <div className={classes.title2}>
                    Building Name props
                </div>


                {/* map floor here*/}

                <div className={classes.inFame}>
                    <div className={classes.title3}>
                        Floor Number props
                    </div>

                    {/* display flex */}
                    <div style={{ display: 'flex' }}>
                        <div className={classes.title4}>
                            Room
                        </div>
                        <div className={classes.title4}>
                            Edit Name Room
                        </div>
                        <div className={classes.title4}>
                            Delete
                        </div>
                    </div>

                    {/* map room here */}
                    <div className={classes.rominfame}>
                        {/* display flex */}
                        <div style={{ display: 'flex' }}>
                            <div className={classes.title5}>
                                props 101
                            </div>
                            <input className={classes.inputSize}>

                            </input>
                            <div className={classes.buttonDelete}>
                                {/* button delete here */}
                            </div>
                        </div>
                    </div>

                </div>




            </div>
        </div>
    )
}
